import React from 'react';

const Header = () => {
    return (
        <div className='text-center uppercase'>
            <h1 className='text-5xl font-bold my-8 '>Test your programming knowledge</h1>
            <h3 className='text-2xl font-medium'>Participate below quizzes.</h3>
        </div>
    );
};

export default Header;
